import ReactDOM from 'react-dom'
import React, { Canvas } from '@react-three/fiber'

function App() {
  return (
    <div id="canvas-container">
      <Canvas />
    </div>
  );
}

ReactDOM.render(<App />, document.getElementById('root'))

export default App;
